import './App.css';
import Navbar from './components/Navbar'
import {Route, Router, Switch} from "react-router-dom";

function App() {
  return (
    <div className="App">
        <Router>
            <Navbar/>
            <Switch>
                <Route path='/' exact/>
            </Switch>
        </Router>
    </div>
  );
}

export default App;
